import logo from './logo.svg';
import './App.css';
import Myname from './components/myName';
import './bootstrap.css';
import Mynav from './components/nav';

import Myemployee from './components/employee';
import Mypic from './components/pic';
function App() {
  return (
    <>
    <div className="App">
      <Mynav></Mynav>

    </div>
    <Myname></Myname>
    <Mypic></Mypic>
    <h2><Myemployee fname="Michal" lname="Haronian" age="19" ></Myemployee></h2>
    </>
  );
}

export default App;
